 To solve this problem, we need to understand the symmetry of a regular pentagon. A regular pentagon has five sides and five angles, and it can be divided into five identical isosceles triangles by connecting its center to each vertex. Each of these triangles represents an angle of 360°/5 = 72° at the center of the pentagon.

When a regular pentagon is rotated about its center, it will coincide with its original position when the angle of rotation is a multiple of 72°. The smallest positive angle that achieves this is 72° itself. Therefore, the minimum number of degrees the pentagon must be rotated to coincide with its original position is 72°.

\boxed{72°}
